INSERT INTO `boxes` (`bid`, `body`, `info`, `format`) VALUES
(1, 'Semi jóias, confeccionadas em prata ou metal e que utilizam pedras naturais ou zircônia (turmalina, safira, pérola, ródio negro, acessórios, ágata, água marinha, amazonita, ametista, apatita, citrino, coral, cristal, dolomita, drusa, esmeralda, granada, jade, madrepérola, quartzo, rubi e turqueza;). <br/>\r\nAcabamentos em prata, ouro, rosé, ródio ou ródio negro. Além de detalhes em cravação, micro cravação e/ou micro pavê. Peças importadas da turquia, china, índia ou tailandia, algumas peças são de fabricação nacional.', 'Rodapé Esquedo', 2);
