('page', 'Página', 'node', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'page'),
('representada', 'Representada', 'node', '', '', 1, 'Nome', 1, 'Descrição', 0, 1, 1, 0, ''),
('depoimentos', 'Depoimentos', 'node', '', '', 1, 'Título', 1, 'Corpo', 0, 1, 1, 0, ''),
('webform', 'Webform', 'node', 'Create a new form or questionnaire accessible to users. Submission results and statistics are recorded and accessible to privileged users.', '', 1, 'Título', 1, 'Corpo', 0, 1, 1, 0, 'webform'),
('home', 'Home', 'node', '', '', 1, 'Título', 1, 'Corpo', 0, 1, 1, 0, ''),
('product', 'Produto', 'uc_product', 'This node displays the representation of a product for sale on the website. It includes all the unique information that can be attributed to a specific model number.', '', 1, 'Nome', 1, 'Descrição', 0, 0, 1, 1, 'product'),
('', '', 'node', '', '', 0, '', 0, '', 0, 1, 0, 0, '');
